            <Flex height="100vh">
                <Sidebar />
                <Container maxW="container.xl">
                    <Grid 
                    h="400px"
                    templateColumns="repeat(5, 1lfr)"
                    gap={4}
                    >
                        <GridItem rowSpan={2} colSpan={1} bg="papayawhip">
                        </GridItem>
                        <GridItem colSpan={3} bg="papayawhip">
                            {GME_GRAPH}
                        </GridItem>
                    </Grid>
                </Container>
            </Flex>
            */
export default StocksPage
